
SET SQL_MODE = "NO_AUTO_VALUE_ON_ZERO";
START TRANSACTION;
SET time_zone = "+00:00";

--
-- Creacion de la Tabla
--

CREATE TABLE `ie` (
  `codModIE` VARCHAR(8) NOT NULL,
  `tipoIE` VARCHAR(20) NOT NULL,
  `provincia` VARCHAR(15) NOT NULL,
  `distrito` VARCHAR(30) NOT NULL,
  `zona` VARCHAR(10) NOT NULL,
  `nivel` VARCHAR(50) NOT NULL,
  `nombreIE` VARCHAR(80) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='Tabla ie' ROW_FORMAT=COMPACT;

